description:
 After being advised by Dr. Brookes to offer sex to her disgruntled patients, Dr. Grey is immediately busted by head doctor Bailey for trying (and failing) to seduce a patient. Facing disciplinary action, Dr. Grey tries to explain herself to Dr. Bailey, who asks her to demonstrate on him exactly what she was going to do. She in turn shows him exactly how much dick a good doctor can suck.


